import React from 'react';
import Carts from '../../components/Carts';


const CartPage = () => {
    return (
        <div className="cart-page">
            <div className="cart__content">
                <h2 className="dash-title">Cart Over Views</h2>
            </div>
            <Carts />
        </div>
    )
}

export default CartPage;
